Kubernetes provides a lot of powerful automation through its built-in APIs, but sometimes you just want to tweak one little thing or add a bit of logic on top. With Metacontroller, you can write and deploy new level-triggered API logic in minutes. The code for your custom controller could be as simple as this example in Jsonnet that adds a label to Pods : // This example is written in Jsonnet (a JSON templating language),
// but you can write hooks in any language.
function(request) { local pod = request.object, local labelKey = pod.metadata.annotations["pod-name-label"], // Inject the Pod name as a label with the key requested in the annotation. labels: { [labelKey]: pod.metadata.name }
} Since all you need to provide is a webhook that understands JSON , you can use any programming language, often without any dependencies beyond the standard library. The code above is not a snippet; it's the entire script. You can quickly deploy your code through any FaaS platform that offers HTTP(S) endpoints, or just load your script into a ConfigMap and launch a simple HTTP server to run it: kubectl create configmap service-per-pod-hooks -n metacontroller --from-file=hooks Finally, you declaratively specify how your script interacts with the Kubernetes API, which is analogous to writing a CustomResourceDefinition (to specify how to store objects): apiVersion: metacontroller.k8s.io/v1alpha1
kind: DecoratorController
metadata: name: pod-name-label
spec: resources: - apiVersion: v1 resource: pods annotationSelector: matchExpressions: - {key: pod-name-label, operator: Exists} hooks: sync: webhook: url: http://service-per-pod.metacontroller/sync-pod-name-label This declarative specification means that your code never has to talk to the Kubernetes API, so you don't need to import any Kubernetes client library nor depend on any code provided by Kubernetes. You merely receive JSON describing the observed state of the world and return JSON describing your desired state. Metacontroller remotely handles all interaction with the Kubernetes API. It runs a level-triggered reconciliation loop on your behalf, much the way CRD provides a declarative interface to request that the API Server store objects on your behalf.

