The sync hook is how you specify which children to create/maintain for a given parent -- in other words, your desired state. Based on the CompositeController spec , Metacontroller gathers up all the resources you said you need to decide on the desired state, and sends you their latest observed states. After you return your desired state, Metacontroller begins to take action to converge towards it -- creating, deleting, and updating objects as appropriate. A simple way to think about your sync hook implementation is like a script that generates JSON to be sent to kubectl apply . However, unlike a one-off client-side generator, your script has access to the latest observed state in the cluster, and will automatically get called any time that observed state changes. Sync Hook Request A separate request will be sent for each parent object, so your hook only needs to think about one parent at a time. The body of the request (a POST in the case of a webhook ) will be a JSON object with the following fields: Field Description controller The whole CompositeController object, like what you might get from kubectl get compositecontroller <name> -o json. parent The parent object, like what you might get from kubectl get <parent-resource> <parent-name> -o json. children An associative array of child objects that already exist. related An associative array of related objects that exists, if customize hook was specified. See the customize hook finalizing This is always false for the sync hook. See the finalize hook for details. Each field of the children object represents one of the types of child resources you specified in your CompositeController spec . The field name for each child type is <Kind>.<apiVersion>, where <apiVersion> could be just <version> (for a core resource) or <group>/<version>, just like you'd write in a YAML file. For example, the field name for Pods would be Pod.v1, while the field name for StatefulSets might be StatefulSet.apps/v1. For resources that exist in multiple versions, the apiVersion you specify in the child resource rule is the one you'll be sent. Metacontroller requires you to be explicit about the version you expect because it does conversion for you as needed, so your hook doesn't need to know how to convert between different versions of a given resource. Within each child type (e.g. in children['Pod.v1']), there is another associative array that maps from the child's path relative to the parent to the JSON representation, like what you might get from kubectl get <child-resource> <child-name> -o json. If the parent and child are of the same scope - both cluster or both namespace - then the key is only the child's .metadata.name. If the parent is cluster scoped and the child is namespace scoped, then the key will be of the form {.metadata.namespace}/{.metadata.name}. This is to disambiguate between two children with the same name in different namespaces. A parent may never be namespace scoped while a child is cluster scoped. For example, a Pod named my-pod in the my-namespace namespace could be accessed as follows if the parent is also in my-namespace: request.children['Pod.v1']['my-pod'] Alternatively, if the parent resource is cluster scoped, the Pod could be accessed as: request.children['Pod.v1']['my-namespace/my-pod'] Note that you will only be sent children that you "own" according to the ControllerRef rules . That means, for a given parent object, you will only see children whose labels match the parent's label selector , and that don't belong to any other parent . There will always be an entry in children for every child resource rule , even if no children of that type were observed at the time of the sync. For example, if you listed Pods as a child resource rule, but no existing Pods matched the parent's selector, you will receive: { "children": { "Pod.v1": {} }
} as opposed to: { "children": {}
} Related resources, represented under related field, are present in the same form as children, but representing resources matching customize hook response for given parent object. Those object are not managed by controller, therefore are unmodificable, but you can use them to calculate children's. Some existing examples implementing this approach are : ConfigMapPropagation - makes copy of given ConfigMap in several namespaces. GlobalConfigMap - makes copy of given ConfigMap in every namespace. SecretPropagation - makes copy of given Secret in reach namespace satisfying label selector. Please note, than when related resources is updated, sync hook is triggered again (even if parent object and children does not change) - and you can recalculate children state according to fresh view of related objects. Sync Hook Response The body of your response should be a JSON object with the following fields: Field Description status A JSON object that will completely replace the status field within the parent object. children A list of JSON objects representing all the desired children for this parent object. resyncAfterSeconds Set the delay (in seconds, as a float) before an optional, one-time, per-object resync. What you put in status is up to you, but usually it's best to follow conventions established by controllers like Deployment. You should compute status based only on the children that existed when your hook was called; status represents a report on the last observed state, not the new desired state . The children field should contain a flat list of objects, not an associative array. Metacontroller groups the objects it sends you by type and name as a convenience to simplify your scripts, but it's actually redundant since each object contains its own apiVersion, kind, and metadata.name. It's important to include the apiVersion and kind in objects you return, and also to ensure that you list every type of child resource you plan to create in the CompositeController spec. If the parent resource is cluster scoped and the child resource is namespaced, it's important to include the .metadata.namespace since the namespace cannot be inferred from the parent's namespace. Any objects sent as children in the request that you decline to return in your response list will be deleted . However, you shouldn't directly copy children from the request into the response because they're in different forms. Instead, you should think of each entry in the list of children as being sent to kubectl apply . That is, you should set only the fields that you care about . You can optionally set resyncAfterSeconds to a value greater than 0 to request that the sync hook be called again with this particular parent object after some delay (specified in seconds, with decimal fractions allowed). Unlike the controller-wide resyncPeriodSeconds , this is a one-time request (not a request to start periodic resyncs), although you can always return another resyncAfterSeconds value from subsequent sync calls. Also unlike the controller-wide setting, this request only applies to the particular parent object that this sync call sent, so you can request different delays (or omit the request) depending on the state of each object. Note that your webhook handler must return a response with a status code of 200 to be considered successful. Metacontroller will wait for a response for up to the amount defined in the Webhook spec .

