Let's take a look at Global Config Map example custom resource object: ---
apiVersion: examples.metacontroller.io/v1alpha1
kind: GlobalConfigMap
metadata: name: globalsettings
spec: sourceName: globalsettings sourceNamespace: global it tells that we would like to have globalsettings ConfigMap from global namespace present in each namespace. The customize hook request will looks like : { 'controller': '...', 'parent': '...'
} and we need to extract information identyfying source ConfigMap. Controller returns : [ { 'apiVersion': 'v1', 'resource': 'configmaps', 'namespace': ${parent['spec']['sourceNamespace']}, 'names': [${parent['spec']['sourceName']}] }, { 'apiVersion': 'v1', 'resource': 'namespaces', 'labelSelector': {} }
] The first RelatedRule describes that given configmap should be returned (it will be used as souce for our propagation). The second RelatedRule describes that we want to recieve also all namespaces in the cluster ('labelSelector': {} means - select all objects). With those rules, call to the sync hook will have non empty related field (if resources exists in the cluster), in which all objects matching given criteria will be present.

