The output resources (in this case just VolumeSnapshot) are the types of objects that the user intends to create and hold in the conceptual "bucket" that the parent object represents. We allow multiple output resources because users might think of their controller as spitting out a few different things. We shouldn't force them to create a CompositeController too just so they can emit multiple outputs, especially if those outputs are not conceptually part of one larger whole. For a given input object, the user can generate any number of output objects. We will tag those output objects in some way to associate them with the object that we sent as input. The tag makes it possible to group those objects and send them along with future map hook requests . In pseudocode, a sync pass could be thought of like the following: // Get all matching objects from all input resources.
inputObjects := []Object{}
for _, inputResource := range inputResources { inputObjects = append(inputObjects, getMatchingObjects(inputResource, parentSelector)...)
}
// Call the once hook for each input object.
for _, inputObject := range inputObjects { // Compute some opaque string identifying this input object. mapKey := makeMapKey(inputObject) // Gather observed objects of the output resources that are tagged with this key. observedOutputs := []Object{} for _, outputResource := range outputResources { // Gather all outputs owned by this parent. allOutputs := getOwnedObjects(outputResource, parent) // Filter to only those tagged for this input. observedOutputs = append(observedOutputs, filterByMapKey(allOutputs, mapKey)...) } // Call user's map hook, passing observed state. mapResult := mapHook(parent, inputObject, observedOutputs) for _, obj := range mapResult.Outputs { // Tag outputs to identify which input they came from. setMapKey(obj, mapKey) } // Manage child objects by reconciling observed and desired outputs. manageChildren(observedOutputs, mapResult.Outputs)
}

